        --------------------------------------------------------------------------------------------


        Good morning, crew.


        Our time with HC-Anchor comes to an end. Consider this a formal goodbye. I have already sold this vessel to an agency. Their tugboat will be arriving at 4:00. Don't worry about yourselves, they'll drop you off at the nearest void-dock. Hope it's a good one.


        Such a shame. We made good money, too. But after our starboard got blown off by local enforcement? No, I'm bailing, cashing out.


        Took the scuttle-box, don't bother looking for me. Took the LR-FTL fuel too! Toodles.

                         Kisses and hugs, best wishes, love,
                                                                  - Cpt. Henry Wishbone
